coll-load_overwrite_text:
Used as intro text for the form.

Followed by the following buttons:
* {{msg-mw|Coll-overwrite}}
* {{msg-mw|Coll-append}}
* {{msg-mw|Coll-cancel}}

coll-cancel:
Used as label for the Cancel button.

Preceded by the link text {{msg-mw|Coll-start book creator}}.
{{Identical|Cancel}}

coll-rendering_title:
Used as page title.

Followed by the page body {{msg-mw|Coll-rendering status}}.
{{Identical|Rendering}}

coll-rendering_failed_status:
Used as <code>$1</code> in:
* {{msg-mw|Coll-rendering failed text}}

Parameters:
* $1 - another message string
{{Identical|Status}}

coll-download_notfound_title:
Used as title for the following error message:
* {{msg-mw|Coll-download notfound text}}.
{{Identical|File not found}}

coll-excluded-templates:
Part of the text of the special page "Rendering finished" which appears after clicking on 'Download' and a book has been generated.

Parameters:
* $1 - the message {{msg-mw|Coll-exclusion category title}}

coll-blacklisted-templates:
Part of the text of the special page 'Rendering finished' which appears after clicking on 'Download' and a book has been generated.

Parameters:
* $1 - the message {{msg-mw|Coll-template blacklist title}}

coll-about_pp:
Parameters:
* $1 - POD partner name. Default value: PediaPress
{{Identical|About}}

coll-suggest_show:
Used as link text.

The tooltip for the link is {{msg-mw|Coll-show collection tooltip}}.

See also:
* {{msg-mw|Coll-show collection}}
{{Identical|Show}}

coll-suggest_article_ban:
Message shown when the user chose to remove a suggested page from the suggestions. Parameters:
* $1 - the title of the removed page
* $2 - a link captioned {{msg-mw|coll-suggest_undo}}

coll-suggest_article_add:
Message shown when the user chose to add a suggested page to his/her book. Parameters:
* $1 - the title of the added page
* $2 - a link captioned {{msg-mw|coll-suggest_undo}}

coll-suggest_article_remove:
Message shown when the user chose to remove a suggested page from his/her book. Parameters:
* $1 - the title of the removed page
* $2 - a link captioned {{msg-mw|coll-suggest_undo}}

coll-create_a_book:
Used as link text in the sidebar.

The link points to the "Book creator" page.
{{Identical|Books}}

coll-book_creator_disable:
(1) Used as page title. The page body for this title is:
* {{msg-mw|Coll-book creator disable text}}

(2) Also used as label for the Submit button which follows the button {{msg-mw|Coll-book creator continue}}.

(3) Also used as link text. The link enables to "Stop book creator".
See also: {{msg-mw|Coll-create a book}}

coll-add_linked_article:
Used in Ajax response.

See also:
* {{msg-mw|Coll-remove linked article}}

coll-remove_linked_article:
Used in Ajax response.

See also:
* {{msg-mw|Coll-add linked article}}

coll-help:
Used as link text.

The tooltip for the link is {{msg-mw|Coll-help tooltip}}.
{{Identical|Help}}

coll-helppage:
{{doc-important|Do not translate "<code>Help:</code>".}}
Used as a link to the help page for this extension's functionality on a wiki.
{{Identical|Book}}

coll-suggest_empty:
Used in list of the proposals/members.

This message indicates that there are no items to show.
{{Identical|Empty}}

coll-setting-papersize:
Label for the "paper size" option.

See also:
* {{msg-mw|Coll-setting-papersize-a4}}
* {{msg-mw|Coll-setting-papersize-letter}}
{{Identical|Paper size}}

coll-setting-papersize-a4:
{{optional}} Name for the A4 paper size

See also:
* {{msg-mw|Coll-setting-papersize}}
* {{msg-mw|Coll-setting-papersize-letter}}

coll-setting-papersize-letter:
Name for the US Letter paper size

See also:
* {{msg-mw|Coll-setting-papersize}}
* {{msg-mw|Coll-setting-papersize-a4}}
{{Identical|Letter}}

coll-setting-toc-auto:
Used to let the backend service decide automatically if a table of contents should be added.

See also:
* {{msg-mw|Coll-setting-toc}}
{{Identical|Automatic}}

coll-setting-toc-yes:
Used to indicate a table of contents is desired.

See also:
* {{msg-mw|Coll-setting-toc}}
{{Identical|Yes}}

coll-setting-toc-no:
Used to indicate a table of contents is not desired.

See also:
* {{msg-mw|Coll-setting-toc}}
{{Identical|No}}

coll-setting-columns:
Label for the "number of columns" option.

See also:
* {{msg-mw|Coll-setting-columns-1}}
* {{msg-mw|Coll-setting-columns-2}}
{{Identical|Column}}
